import React from "react";

export const FlowerCartAddress = () => {
  return (
    <article className="Flowers__Cart__DeliveryInfo">
      <input type="address" id="delivery_address" />
      <label for="delivery_time">Better to deliver on:</label>
      <select id="delivery_time" name="Delivery time">
        <option>12-14</option>
        <option>14-16</option>
        <option>16-18</option>
        <option>18-20</option>
        <option>20-22</option>
      </select>
    </article>
  );
};
